import {GET_DOGS} from '../constants'
import axios from 'axios'

export function getDogs (){
  return function (dispatch){
      const init = {
        method: 'GET'
      }
    fetch('/home/dogs', init)
      .then(response => response.json())
      .then(json => dispatch({type: GET_DOGS, payload: json}))
    }
}
